import * as React from 'react';
import Box from '@mui/material/Box';
import OutlinedInput from '@mui/material/OutlinedInput';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const urlAlumnos="http://127.0.0.1:8000/drey/v1/Alumno/";

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];
const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 800,
  bgcolor: 'background.paper',
  border: '2px solid #000',
  boxShadow: 24,
  p: 4,
};


  
export default function InputAdornments() {
  const [values, setValues] = React.useState({
    amount: '',
    password: '',
    weight: '',
    weightRange: '',
    showPassword: false,
  });

  const handleChange = (prop) => (event) => {
    setValues({ ...values, [prop]: event.target.value });
  };

  const handleClickShowPassword = () => {
    setValues({
      ...values,
      showPassword: !values.showPassword,
    });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };
  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
      <Box sx={{ display: 'flex', flexWrap: 'wrap',mb: 1 , marginLeft:10 }}  >
  
      <Button onClick={handleOpen} variant="contained" disableElevation sx={{ left:1 }}>
      Agregar Alumno
    </Button>
      <div style={{ height: 400, width: '95%'}}>
      <Typography variant="h5" sx={{ mb: 1 , marginLeft:2}}>
        Lista
        </Typography>
        <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Dessert (100g serving)</TableCell>
            <TableCell align="right">Calories</TableCell>
            <TableCell align="right">Fat&nbsp;(g)</TableCell>
            <TableCell align="right">Carbs&nbsp;(g)</TableCell>
            <TableCell align="right">Protein&nbsp;(g)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
      <Button variant="contained" disableElevation>
  Asignar
</Button>
    </div>


    
      <Modal
        open={open}
        onClose={handleClose}
        aria-labelledby="modal-modal-title"
        aria-describedby="modal-modal-description"
      >
        <Box sx={style}>
        <div>
        <TextField
          label="Nombre"
          id="outlined-start-adornment"
          sx={{ m: 1, width: '25ch' }}
         
        />
        <TextField
          label="Apellido P"
          id="outlined-start-adornment"
          sx={{ m: 1, width: '25ch' }}
         
        />
        <TextField
          label="Apellido M"
          id="outlined-start-adornment"
          sx={{ m: 1, width: '25ch' }}
         
        />
        <TextField
          label="Semestre"
          id="outlined-start-adornment"
          sx={{ m: 1, width: '15ch' }}
         
        />

<TextField
          id="standard-select-currency"
          select
          label="Select"
          
          onChange={handleChange}
          helperText="Selecciona el Grupo"
          variant="standard"
        >
        
        </TextField>
        <FormControl fullWidth sx={{ m: 1 }}>
          <InputLabel htmlFor="outlined-adornment-amount">Correo</InputLabel>
          <OutlinedInput
            id="correo"
            value={values.amount}
            onChange={handleChange('amount')}
           
            label="Correo"
          />
        </FormControl>
      </div>
     
        </Box>
      </Modal>
      
    
    </Box>
  );
}
